import React, { useEffect, useState } from 'react';
import axios from 'axios';
// import { useNavigate } from 'react-router-dom';
import './MedicalRecords.css'; 

const MedicalRecordList = () => {
    const [records, setRecords] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    // const navigate = useNavigate();

    useEffect(() => {
        const fetchRecords = async () => {
            try {
                const response = await axios.get('http://localhost:8080/api/medical-records');
                console.log('Fetched Records:', response.data);  // âœ… Check the data
                setRecords(response.data);
            } catch (error) {
                console.error('Error fetching records:', error);
                setError('Failed to fetch records.');
            } finally {
                setLoading(false);
            }
        };

        fetchRecords();
    }, []);

    // const handleAddRecord = () => {
        // navigate('/addmedical-record');
    // };

    if (loading) return <p>Loading...</p>;
    if (error) return <p>{error}</p>;

    return (
        <div style={{ padding: '20px' }}>
            <h2>Medical Records</h2>
            {/* <button onClick={handleAddRecord} style={{ marginBottom: '15px' }}>Add Medical Record</button> */}
            <table border="1" cellPadding="10" cellSpacing="0" style={{ width: '100%' }}>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Diagnosis</th>
                        <th>Treatment</th>
                        <th>Prescription</th>
                        <th>Created At</th>
                        <th>Updated At</th>
                        <th>Patient Name</th>
                        <th>Patient Email</th>
                        <th>Patient Phone</th>
                        <th>Patient Age</th>
                        <th>Patient Gender</th>
                        <th>Patient Address</th>
                    </tr>
                </thead>
                <tbody>
                    {records.map((record) => (
                        <tr key={record.id}>
                            <td>{record.id}</td>
                            <td>{record.diagnosis}</td>
                            <td>{record.treatment}</td>
                            <td>{record.prescription || 'N/A'}</td>
                            <td>{record.createdAt ? new Date(record.createdAt).toLocaleString() : 'N/A'}</td>
                            <td>{record.updatedAt ? new Date(record.updatedAt).toLocaleString() : 'N/A'}</td>
                            <td>{record.patient?.firstName} {record.patient?.lastName}</td>
                            <td>{record.patient?.email}</td>
                            <td>{record.patient?.phone}</td>
                            <td>{record.patient?.age}</td>
                            <td>{record.patient?.gender}</td>
                            <td>{record.patient?.address}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default MedicalRecordList;
